import React from 'react';
import Navigation from '../components/Navigation';
import SocialNetwork from '../components/SocialNetwork';

const Home = () => {
    return (
        <div>
            <Navigation />
            <SocialNetwork />
            <div className="home-main">
                <div className="min-content">
                    <h1>FS AGENCY</h1>
                    <h2>DynamicText</h2>
                </div>
            </div>
        </div>
    );
};

export default Home;
